import re
from datetime import datetime

# ============================================================
# VERSÃO OTIMIZADA - Processa todos os items de uma vez sem loop
# ============================================================

# Configuração
colunas_float = [
    "monto_total",
    "transferido_remunerado",
    "transferido_no_remunerado",
    "issue_monto"
]
coluna_data = "carimbo_de_datahora"

# Funções auxiliares (compiladas uma vez para melhor performance)
_regex_limpeza = re.compile(r'[^a-zA-Z0-9\s_]')
_regex_espacos = re.compile(r'[\s_]+')


def limpar_cabecalho(texto):
    """Limpa cabeçalho removendo caracteres especiais e normalizando."""
    if not texto:
        return "coluna_vazia"
    texto_str = str(texto)
    limpo = _regex_limpeza.sub('', texto_str)
    limpo = _regex_espacos.sub('_', limpo)
    return limpo.strip('_').lower()


def converter_para_float(valor):
    """Converte valor para float, tratando formatos brasileiros/europeus."""
    if valor is None or valor == "":
        return 0.0
    if isinstance(valor, (int, float)):
        return float(valor)

    valor_str = str(valor).strip().replace('R$', '').replace('$', '').strip()

    # Formato brasileiro: 1.000,00 -> 1000.00
    if ',' in valor_str and '.' in valor_str:
        valor_str = valor_str.replace('.', '').replace(',', '.')
    elif ',' in valor_str:
        valor_str = valor_str.replace(',', '.')

    try:
        return float(valor_str)
    except (ValueError, TypeError):
        return 0.0


def converter_data(valor):
    """Converte data de DD/MM/YYYY HH:MM:SS para YYYY-MM-DD HH:MM:SS."""
    if not valor:
        return None
    valor_str = str(valor).strip()

    formatos = ['%d/%m/%Y %H:%M:%S', '%d/%m/%Y']
    for fmt in formatos:
        try:
            dt_obj = datetime.strptime(valor_str, fmt)
            return dt_obj.strftime('%Y-%m-%d %H:%M:%S' if ':' in fmt else '%Y-%m-%d')
        except ValueError:
            continue
    return None


def processar_item(item):
    """Processa um único item, retornando o JSON limpo."""
    linha_original = item.get('json', {})
    linha_limpa = {}

    for chave, valor in linha_original.items():
        nova_chave = limpar_cabecalho(chave)

        if nova_chave == coluna_data:
            linha_limpa[nova_chave] = converter_data(valor)
        elif nova_chave in colunas_float:
            linha_limpa[nova_chave] = converter_para_float(valor)
        else:
            linha_limpa[nova_chave] = str(valor) if valor is not None else ""

    return linha_limpa


# ============================================================
# PROCESSAMENTO EM LOTE (TODOS OS ITEMS DE UMA VEZ)
# ============================================================

# Processa todos os items de uma vez (otimizado)
for item in items:
    item['json'] = processar_item(item)

return items
